    const [render, setRender] = useState(true);
    const removeWelcome = () => {
        setRender(false)
    };


    return (
        <>
            {render && (
                <div className="temp" onAnimationEnd={() => removeWelcome()}>Hello</div>
            )}
        </>
    )
};

